// pages/Home.js
import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="home-page">
      <h1>Welcome to PDF Co-Viewer</h1>
      <p>Upload and sync your PDF files for a seamless viewing experience.</p>
      <Link to="/upload">
        <button className="home-upload-button">Get Started</button>
      </Link>
    </div>
  );
};

export default Home;
